INSERT INTO `tbl_centros` (`id`, `nombre`, `buzon`, `telefono`, `direccion`, `descripcion`, `equipamiento`, `acceso`, `horario`, `active`, `lat`, `lng`, `path`, `file`, `media`) VALUES
(1, 'CIFO La Violeta', 'cifo_violeta.soc@gencat.cat ', ' 932 54 17 00', 'Plaza del Conde de Sert, 25. ¿08035 Barcelona?', '<div class="col"><p>El CIFO Barcelona- la Violeta trabaja para la cualificación y recualificación profesional de las persones que quieren mejorar sus competencias profesionales en el sector de la tecnología de la información y de la comunicación.</p><p>Nuestra oferta formativa es muy amplia y responde a la constante evolución y crecimiento del sector de las TIC, uno de los sectores económicos emergentes con más potencial para crear empleo.</p><p><a href="/es/detall/article/Itineraris-Formatius-2018">Itinerarios formativos del CIFO Barcelona- la Violeta</a></p><ul><li>Programación BBDD y BigData</li><li>Programación y desarrollo de aplicaciones</li><li>Sistemas informáticos y seguridad</li><li>Redes sociales</li></ul></div>', '<div class="col"> 					<p>Sobre una superficie construida de 3.800 m2, en un recinto de 8.800 m2, hay de diecisiete aulas, una biblioteca, despachos, conserjería, cafetería y un salón de actos con capacidad para más de cien personas, esta sala dispone de una pizarra digital interactiva (PDI)</p> <p><strong>Aulas de formación</strong></p> <p>Las aulas de formación están completamente equipadas con 15/16 equipos informáticos para los alumnos, un equipo para el profesional que imparte el curso, equipamientos de laboratorio para hacer prácticas, y en proyector, pantalla, audio y pizarra. Eso supone una capacidad para 250 alumnos simultáneos, contando una media de 15/16 alumnos por aula, aunque algunas están preparadas para dar capacidad efectiva hasta 20 plazas para el alumnado.</p> <p>Disponemos de un aula polivalente, sin equipos informáticos para los alumnos, orientada a favorecer las acciones formativas que necesiten la interactuación de grupos de trabajo.</p> <p>&nbsp;</p>  			</div>', '<p>Bus: 60, H4, V15, bus barrio 124</p><p>Metro: Vall d''Hebron + bus / Metro: Penitents+bus 124</p><p>Coche: Ronda de Encima de B20, salida 6 (Vallcarca)</p>', 'Lunes - Viernes: 8:00 AM to 21:00 PM', 1, '41.41677869999999', '2.1329792000000225', '/media/centros/', 'CIFO_1.jpg', 'data:image/jpeg;base64,');
INSERT INTO `tbl_centros` (`id`, `nombre`, `buzon`, `telefono`, `direccion`, `descripcion`, `equipamiento`, `acceso`, `horario`, `active`, `lat`, `lng`, `path`, `file`, `media`) VALUES
(2, 'CIFO Sabadell', 'cifo_sabadell.soc@gencat.cat', '937 36 29 10 ', 'Carretera Nacional 150 km.15\r\n08227 Terrassa ‎', '<div class="pd-15x"><p>Somos un centro público de formación profesional para el empleo, especializado en las familias profesionales de Instalación y Mantenimiento, de Logística, de Fabricación Mecánica y de Electricidad y Electrónica.&nbsp;</p>\r\n<p>Formamos parte de la red de ocho Centros propios de Innovación y Formación Ocupacional (CIFO) del Servicio Público de Empleo de Catalunya (SOC) y de esta manera contribuimos con la cualificación, la recalificación o la actualización de las competencias profesionales de los trabajadoras y trabajadoras, prioritariamente en situación de paro, favoreciendo la inserción laboral y la competitividad de las empresas.&nbsp;</p>\r\n<p>Nuestra oferta formativa está vincula en el sector industrial y da respuesta a las demandas de calificación de los sectores económico dominantes en las comarcas del Vallès como|cómo son la logística, la mecánica industrial o el mantenimiento de equipamientos industriales.&nbsp;</p>\r\n<p>Seguimos a un modelo de formación teòricopràctica que se desarrolla en un entorno real de trabajo. Nuestros alumnos adquieren las competencias profesionales en base a proyectos y/o la elaboración de productos y o servicios que reproducen la realidad productiva.&nbsp;</p>\r\n<p>Impartimos cursos de diseño propio, del catálogo de especialidades formativas y de certificados de profesionalidad, e incorporamos las innovaciones tecnológicas a los programas formativos. Completamos la formación con charlas y visitas a las empresas punteras y referentes de las especialidades formativas.&nbsp;</p>\r\n<p>En el caso de los certificados de profesionalidad, la formación puede incluir, además, prácticas profesionales no laborales.</p></div>', '<div class="cos_bloc basic_text_peq pd-15">\r\n					<p>Llevamos a cabo nuestra actividad en la sede de Terrassa, en el Vallès Occidental, y a la subsede de Les Franqueses del Vallès, en el Vallès Oriental.</p>\r\n<h3><strong>CIFO Sabadell Terrassa (Vallès Occidental)</strong>&nbsp;</h3>\r\n<p>La superficie construïda es de 2.350 m<sup>2</sup> y consta del edificio principal de una sola planta, donde se encuentran las 13 aulas taller, el área de administración, y los pequeños almacenes interiores, el archivo, y los tres almacenes exteriores de aproximadamente 107,92 m<sup>2</sup> destinados al almacenaje de materiales pesados.</p>\r\n<p><strong>Subsede en les Franqueses del Vallès (Vallès Oriental)</strong>&nbsp;</p>\r\n<p>Sobre una superficie construida de 3.800 m<sup>2</sup>, en un recinto de 8.800 m<sup>2</sup>, el centro dispone de tres edificaciones que suman diecisiete aulas, una biblioteca, despachos, conserjería, cafetería y un salón de actos con capacidad para más de cien personas.</p>\r\n<p>El edificio principal, dónde se encuentran las 10 aulas taller y la zona destinada a los servicios administrativos&nbsp;</p>\r\n<p>Anexo en el edificio principal encontramos la nave, de planta baja y sección rectangular de aproximadamente 450 m<sup>2</sup>. dónde se encuentran dos talleres, un aula de teoría común en los dos talleres, y finalmente, el auditorio, edificio anexo e independiente, que se destina a actividades polivalentes como teorías, impartición de módulos complementarios, sesiones de información y orientación, etc.</p>\r\n			</div>', '<p>Bus C5 i C7 (interurbana de Sabadell Y Terrassa. Parada: Mancomunitat</p><p>Salida 15 de la C58</p>', 'Lunes - Viernes: 8:00 AM to 21:00 PM', 1, '41.5550049', '2.0592602', '/media/centros/', 'CIFO_2.jpg', 'data:image/jpeg;base64,');
INSERT INTO `tbl_centros` (`id`, `nombre`, `buzon`, `telefono`, `direccion`, `descripcion`, `equipamiento`, `acceso`, `horario`, `active`, `lat`, `lng`, `path`, `file`, `media`) VALUES
(3, 'CIFO Santa Coloma', 'cifo_santacoloma.soc@gencat.cat', '93 254 17 00', 'Estamos situados en una zona residencial y de equipamientos sociales.\r\n\r\nDirección: avenida Ramon Berenguer IV, 74, Santa Coloma de Gramenet', '<div class="pd-15x"><p>Somos uno de los centros propios de Innovación y Formación Ocupacional del Servicio de Público de Empleo de Catalunya, especializado en las familias profesionales <em>de Agraria, Seguridad y Medio Ambiente, de Energía y Agua, Instalaciones y Mantenimientos, Electricidad y Electrónica y Rehabilitación ecoeficiente</em>.</p>\r\n<p>La economía verde es el eje de nuestra programación formativa que ve en el desarrollo sostenible la oportunidad de la calificación y recalificación profesional.</p>\r\n<p>Impartimos cursos de certificados de profesionalidad, del Catálogo de especialidades del SOC y de diseño propio. Estos cursos están dirigidos prioritariamente a la personas en situación de desempleo, y están orientados a la adquisición y actualización de las competencias profesionales.</p>\r\n<p>Ofrecemos una formación teoricopràctica, en base a propuestas y o proyectos, simulando el entorno real de trabajo. Así, se crean las condiciones necesarias para que el alumnado alcance las competencias profesionales requeridas en el mercado laboral.</p>\r\n<p>Además, fomentamos la colaboración con empresas de los sectores económicos de las familias y àreas profesionales del CIFO con la finalidad de conocer y transferir a nuestros programas formativos las innovaciones tecnológicas.&nbsp;</p>\r\n<p>Los formadores y los formadores del CIFO provienen del sector productivo y cuentan, además, con la formación metodológica y didáctica adecuada para impartir los cursos.</p></div>', '<div class="cos_bloc basic_text_peq pd-15">\r\n					<p>El CIFO cuenta con una superficie total de 7.865 m2, de los cuales 4.655 m<sup>2</sup>  son de zona ajardinada. Se distribuyen en 13 aulas para la impartición técnica y teórica de los programas formativos y 5 talleres (electricidad y energías renovables, agua, carpintería, climatización-gas y construcción) para la impartición práctica; además de una sala de descanso/cafetería, salón de actos y del centro de documentación.</p>\r\n<p>Disponemos de los recursos materiales específicos para cada especialidad para impartir la formación, tanto en el suyo vertiente teórico como en el práctico.</p>\r\n<p>Los talleres y la zona ajardinada reproducen entornos reales de trabajo y son fundamentales para el desarrollo de los contenidos prácticos de los cursos.</p>\r\n			</div>', '<p><strong>Medios de transporte público</strong></p><p>Metro L1 (estación Santa Coloma)</p><p>Metro L9 - Norte (estación Singuerlín)</p><p>Autobús B-30 (parada delante del Centro)</p><p>B-20, B27 y B-80</p>', 'Lunes - Viernes: 8:00 AM to 21:00 PM', 1, '41.46440499999999', '2.2081550000000334', '/media/centros/', 'CIFO_3.jpg', 'data:image/jpeg;base64,');
INSERT INTO `tbl_centros` (`id`, `nombre`, `buzon`, `telefono`, `direccion`, `descripcion`, `equipamiento`, `acceso`, `horario`, `active`, `lat`, `lng`, `path`, `file`, `media`) VALUES
(4, 'CIFO L’Hospitalet', 'cifo_hospitalet.soc@gencat.cat ', '93 260 31 20', 'Carretera del Mig, 24 (esquina calle Leonardo da Vinci) 08907 Hospitalet de Llobregat', '<p>El Centro de Innovación y Formación para el Empleo (CIFO) del Hospitalet ofrece formación en las áreas de Edición y de Diseño gráfico y Multimedia, a trabajadores en activo y en situación de desempleo de los sectores de diseño gráfico y de el audiovisual clásico, con el objetivo de brindar la especialización necesaria para dedicarse a los ámbitos emergentes del diseño gráfico multiplataforma, el multimedia editorial especialmente en el ámbito de productos educativos, la formación on-line, y el animación, el videojuego y la creación de entornos virtuales.</p>', '<div class="row"> 	<div class="basic_text col-xs-12 pd-30 off-margin-bottom pd-15">		<p>El centre disposa d’instal·lacions tecnològicament avançades:</p>\r\n		</div><div class="basic_text_peq col-xs-12">	<div class="pd-15x"><p>Al <strong>CIFO</strong></p>\r\n<ul>\r\n<li>9 aules amb equipament informàtic (aules de la 2 a la 9)</li>\r\n<li>1 aula polivalent sense dotació informàtica per a alumnes (Aula 1)</li>\r\n<li>1 Plató de rodatge amb sala de realiztació</li>\r\n<li>1 Plató de rodatge amb sala de realització /aula tècnica per a Stop motion</li>\r\n<li>Sala de locució</li>\r\n<li>Sala d’edició</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>A les 9 aules amb dotació informàtica, tots els equips estan instal·lats en xarxa, amb accés a Internet i a servidor de mitjans audiovisuals (Editsare). El centre disposa d’un repetidor wi-fi, disponible per a les aules que ho sol·licitin, quan escau l’ús addicional de tablets, dispositius mòbils, o altres perifèrics que s’hagin de connectar a Internet per a projectes concrets.</p></div>\r\n</div></div>', '<p><strong>Transportes públicos:</strong></p><p>Ferrocarriles de la Generalitat de Catalunya (FGC), estación Sant Josep)</p><p>Renfe cercanías (estación Bellvitge)<br>Línea R2 destino final Vilanova i la Geltrú, Castelldefels, Aeropuerto</p><p>Metro:&nbsp;Línea 9 estación Can Tries/Gornal</p><p>Autobuses:<br>L12, L52, parada en Enric Prat de la Riba/Ventura Gassol<br>LH1, LH2, parada en Travessia Industrial/Miquel Romeu<br>L14, parada en Avenida Fabregada/Cobalt</p>', 'Lunes - Viernes: 8:00 AM to 21:00 PM', 1, '41.3594002', '2.11336510000001', '/media/centros/', 'CIFO_4.jpg', 'data:image/jpeg;base64,');
INSERT INTO `tbl_centros` (`id`, `nombre`, `buzon`, `telefono`, `direccion`, `descripcion`, `equipamiento`, `acceso`, `horario`, `active`, `lat`, `lng`, `path`, `file`, `media`) VALUES
(5, 'CIFO Lleida', 'cifo_lleida.soc@gencat.cat', '973 72 76 20', ' calle Enric Farreny, 3 25199 – Lérida', '<div class="pd-15x"><p>Somos el centro público de formación profesional para el empleo de las tierras de ponente. Nuestra programación formativa incluye especialidades de las familias profesionales <em>Instalación y Mantenimiento, Fabricación Mecánica, Electricidad y electrónica y Energia y Agua</em> que son de aplicación al sector agrario y a la industria agroalimentaria.</p>\r\n<p>Formamos parte de la red de centros de refèrencia en la formación ocupacional del Servicio de Público de Empleo de Cataluña, y de este manera, contribuye a la calificación profesional de las personas trabajadoras y la mejora de la competitivat de las empresas de Lérida.</p>\r\n<p>Nuestros servicios de formación se dirigen a trabajadores y trabajadoras (prioritariamente en situación de paro) inscritos en las oficinas de trabajo del TRONCO.</p>\r\n<p>Ofrecemos una formación teoricopràctica en un entorno real de trabajo para que los alumnos alcancen o mejoren sus competencias profesionales. Las clases se desarrollan en las aulas y los talleres del centro e incluyen sesiones técnicas y prácticas que simulan un contexto real de trabajo. El proyecto del curso y el desarrollo de productos o servicios son el eje vertebrador de nuestra formación, que puede incluir, en el caso de los certificados de profesionalidad, prácticas en empresas.</p></div>', '<div class="cos_bloc basic_text_peq pd-15">\r\n					<p>El CIFO dispone de cinco aulas, siete talleres y de un salón de actos.&nbsp;</p>\r\n<p>Los talleres reproducen entornos reales de trabajo y son fundamentales para impartir los contiguts prácticos de los cursos.</p>\r\n<ul>\r\n<li>Taller de Fred y Climatización</li>\r\n<li>Taller de Soldadura</li>\r\n<li>Taller de Energías renovables:</li>\r\n<li>Taller de Carnicería y Elaboración de Productos Cárnicos:</li>\r\n<li>Taller de Electricidad</li>\r\n<li>Taller de pintura decorativa en construcción</li>\r\n<li>Taller de Lampistería</li>\r\n</ul>\r\n			</div>', '<p>El centro está situado al lado del Pabellón Municipal de Deportes ''Once de Septiembre'' y cerca del Campo de Deportes de la Lérida.</p><p>Como llegar en transporte público (autobús):&nbsp;</p><p>L-2 Ronda-Hospitales</p><p>L-3 Exterior-Hospitales &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>L-5 Dra. Castells-Arnau de Vilanova-Pardinyes</p><p>L-6 Mercado Bordeta- Agrònoms -Tanatorio</p>', 'Lunes - Viernes: 8:00 AM to 21:00 PM', 1, '41.6240353', '0.6112372999999707', '/media/centros/', 'CIFO_5.jpg', 'data:image/jpeg;base64,'),
(6, 'CIFO Salt', 'cifo_salt.soc@gencat.cat. ', '972 40 55 70', 'c/Alfons Moré, 1, Salt:17190', '<div class="pd-15x"><p>Somos un centro público de formación profesional para el empleo especializado en las familias profesionales de Industrias Alimenticias, Química y Fabricación Mecánica.&nbsp;</p>\r\n<p>Formamos parte de la red de centros propios de innovación y formación ocupacional del Servicio de Público de Empleo de Catalunya, y somos uno de los instrumentos para la cualificación o recualificación profesional de las personas trabajadoras.&nbsp;</p>\r\n<p>El sector de las industrias alimenticias y de la fabricación mecánica y sus actividades económicas auxiliares son el eje de nuestra programación formativa, que paralelamente incorpora otras especialidades, y responde así a las demandas de formación de los sectores económicos tradicionales y emergentes del territorio.&nbsp;</p>\r\n<p>Nuestros servicios de formación se dirigen a trabajadores y trabajadoras (prioritariamente personas desocupadas) inscritos en las oficinas de trabajo del SOC.&nbsp;</p>\r\n<p>Ofrecemos una formación teoricopràctica en un entorno real de trabajo para que los alumnos alcancen o actualicen sus competencias profesionales. Las clases se desarrollan en las aulas y los talleres del centro e incluyen sesiones técnicas y prácticas que simulan un contexto real de trabajo.&nbsp;</p>\r\n<p>Incorporamos las innovaciones tecnológicas a los programas formativos y los completamos con charlas y visitas a las empresas punteras y referentes del entorno productivo. En el caso del certificados de profesionalidad, la formación puede incluir, además, prácticas profesionales no laborales.&nbsp;</p>\r\n<p>Contamos, para los desarrollo de los programas, con formadores y formadores con expèriencia profesional en el sectores productivos y con formación metodológica en la impartición de cursos de formación profesional ocupacional.</p></div>', '<div class="cos_bloc basic_text_peq pd-15">\r\n					<p>El centro dispone de los talleres siguientes: obrador para la elaboración de alimentos, frío industrial y comercial, laboratorio químico, soldadura, mecanización en turno y desove convencional y control numérico y electricidad de edificios. También dispone de dos aulas de informática y cinco aulas para formación.&nbsp;</p>\r\n<p>Los talleres reproducen entornos reales de trabajo y son fundamentales para impartir los contenidos prácticos de los cursos.</p>\r\n			</div>', '<p>El acceso al centro se puede hacer mediante transporte público: L3 i L4</p>', 'Lunes - Viernes: 8:00 AM to 21:00 PM', 1, '41.9728597', '2.8012807000000066', '/media/centros/', 'CIFO_6.jpg', 'data:image/jpeg;base64,');
INSERT INTO `tbl_centros` (`id`, `nombre`, `buzon`, `telefono`, `direccion`, `descripcion`, `equipamiento`, `acceso`, `horario`, `active`, `lat`, `lng`, `path`, `file`, `media`) VALUES
(7, 'CIFO Sant Feliu', 'cifo_santfeliu.soc@gencat.cat', '93 685 77 90', 'c/Hospitalet, 3 (esquina N-II)\r\n08980 - Sant Feliu de Llobregat (Barcelona)', '<div class="pd-15x"><p>Somos un centro público de formación profesional por el empleo del Servicio Público de Empleo de Catalunya.</p>\r\n<p>Formamos parte de la red de centros propios de innovación y formación ocupacional del Servicio Público de Empleo de Cataluny&lt;a y es uno de los el instrumento para la cualificación o recualificación profesional de las personas trabajadoras.</p>\r\n<p>Estamos situados en la comarca del Baix Llobregat, que tiene una importante presencia de se la industria metalúrgica y de la automoción, y somos referentes en las familias profesionales de <em>Fabricación Mecánica, Automoción y Electricitat Electrónica</em>.</p>\r\n<p>Además, formamos parte de la Red de Centros de Referencia Nacional a nivel estatal, en la familia de <em>Fabricación mecánica</em>, y centro referente en el área de Operaciones Mecánicas.</p>\r\n<p>Las áreas de diseño y prototipaje industrial con CATIA y Siemens NX, mecanización con CNC, soldadura, electricidad, automatización y robótica forman el eje de las nuestra programación formativa.</p>\r\n<p>Paralelamente, y cumpliendo con las funciones de Centro de referencia y de innovación, diseñamos y experimentamos nuevas especialidades formativas innovadoras que dan respuesta a a los nuevos avances tecnológicos y a la aparición de los nuevos perfiles profesionales en el sector industrial</p>\r\n<p>Nuestros servicios de formateo se dirigen a trabajadores y trabajadoras (prioritariamente en situación de paro) inscritos en las Oficinas de Trabajo del SOC.</p>\r\n<p>Ofrecemos una formación teoricopràctica en un entorno real de trabajo para que los alumnos alcancen o actualicen sus competencias profesionales. Las clases se desarrollan en las aulas y los talleres del centro e incluyen sesiones técnicas y prácticas que simulan un contexto real de trabajo.</p>\r\n<p>Incorporamos las innovaciones tecnológicas a los programas formativos y los completamos con charlas y visitas a las empresas punteras y referentes del entorno productivo. En el caso de los certificados de profesionalidad, la formación incluye, además, prácticas profesionales no laborales.</p>\r\n<p>Igualmente, contamos para los desarrollo de los programas con formadores y formadores con experiencia profesional en el sectores productivos y formación metodológica en la impartición de cursos de formación profesional ocupacional.</p></div>', '<div class="cos_bloc basic_text_peq pd-15">\r\n					<p>El Centro dispone de las instalaciones y talleres siguientes:</p>\r\n<p>Taller Mecánica Convencional</p>\r\n<p>Aula-Taller de Mecànització con Control Numérico</p>\r\n<p>Taller de Soldadura</p>\r\n<p>Aula-Taller de Automatismos</p>\r\n<p>Aula-Taller de Diseño y fabricación de Prototips,</p>\r\n<p>Aula-Taller de Electricidad Baja Tensión</p>\r\n<p>Aula-Taller de Electricidad Industrial</p>\r\n<p>Aula-Taller de Mecatrónica</p>\r\n<p>Aula-Taller de Automoción</p>\r\n<p>Aulas de Diseño Industrial CAD/CAM con CATIA, SIEMENS NX I MASTERCAM</p>\r\n<p>Aula de formación de formadores</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>Los talleres reproducen entornos reales de trabajo y son fundamentales para impartir los contiguts prácticos de los cursos.</p>\r\n\r\n\r\n	</div>', '', 'Lunes - Viernes: 8:00 AM to 21:00 PM', 1, '41.38594579999999', '2.0409815000000435', '/media/centros/', 'CIFO_7.jpg', 'data:image/jpeg;base64,');
INSERT INTO `tbl_centros` (`id`, `nombre`, `buzon`, `telefono`, `direccion`, `descripcion`, `equipamiento`, `acceso`, `horario`, `active`, `lat`, `lng`, `path`, `file`, `media`) VALUES
(8, 'CIFO Tarragona', 'cifo_tarragona.soc@gencat.cat', '977 25 15 66', 'Cami de la Budellera s/n – 43007 Tarragona', '<div class="pd-15x"><p>Somos un centro público de formación profesional para el empleo referente en las familias profesionales de <em>Química, Fabricación mecánica y Seguridad y Medio Ambiente</em>.</p>\r\n<p>Formamos parte de la red de centros propios del Servicio Público de Empleo de Catalunya, e impartimos cursos de diseño propio, del catálogo y de certificados de profesionalidad, prioritariamente dirigidos a personas desocupadas y orientados a la adquisición y/o la actualización de competencias profesionales.</p>\r\n<p>Ofrecemos formación de especialidades que corresponden a los empleos emergentes y/o más demandadas del sector químico y la industria pesada, ámbitos con un peso importante en nuestro territorio. Asimismo, damos cabida a formación ocupacional más transversal.&nbsp;</p>\r\n<p>Nuestra formación está estrechamente vinculada a la práctica profesional. En nuestros cursos, los alumnos aprenden en un entorno real de trabajo, e integran la formación teórica con la práctica. El objetivo es que los alumnos adquieran las competencias técnicas y del contexto profesional de los empleos para las cuales se estàn formando.</p>\r\n<p>Además, contamos con la asistencia de empresas punteras del sector químico y de la industria pesada que nos transfieren el saber hacer, así como las nuevas tecnologías y materiales de los correspondientes entornos productivos.&nbsp;</p>\r\n<p>Los formadores y los formadores del centro provienen del sector productivo y contamos además, con la formación metodológica y didáctica adecuada para desarrollar los cursos.</p></div>', '<div class="cos_bloc basic_text_peq pd-15">\r\n					<p>Las instalaciones y equipamientos del CIFO Tarragona se distribuyen en tres edifics principales sobre una superficie de aproximadamente 11.000 m<sup>2</sup>.&nbsp;</p>\r\n<p><strong>El edificio A</strong> es un edificio de dos plantas destinado principalmente a los servicios administrativos que también dispone de un salón de actos con una capacidad para 40 personas y una sala comedor con máquinas expendedoras de café, bebidas y refrigerios, fuente de agua, nevera y microondas.</p>\r\n<p><strong>El edificio B</strong> es un edificio de dos plantas con aulas formativas equipadas con medios audiovisuales, dos aulas ofimáticas, un laboratorio de química, un taller de diseño industrial y un taller multidisciplinar de operaciones básicas de planta química, neumática e hidráulica.&nbsp;</p>\r\n<p><strong>El edificio C</strong> dispone de tres talleres: uno de soldadura con 15 cabinas equipadas con diversos grupos adelantados, uno de mecanización con máquinas semiautomáticas y un turno con CNC, y un taller de fabricación de cañería industrial. El edificio dispone también de una zona exterior por operaciones de corte, prácticas de operaciones de planta química y fabricación de cañería así como almacén exterior de gases y residuos.</p>\r\n			</div>', '<p><strong>Transporte público</strong></p><p>Autobuses L1 y L9, L11, L12, y L13</p>', 'Lunes - Viernes: 8:00 AM to 21:00 PM', 1, '41.1258723', '1.2803524999999354', '/media/centros/', 'CIFO_8.jpg', 'data:image/jpeg;base64,');
